Интересные факты о МГУ 
 в ведущем высшем учебном заведении Москвы обучается свыше 50 000 студентов; 
деятельность организации регулируется Федеральном законом, дающим особое право выдавать молодым специалистам дипломы собственного образца; 
на главном здании размещены самые большие механические часы в России — диаметр их циферблата почти 9 м, часовая стрелка весит 50 кг, а минутная —39; 
здесь в 1989 году был открыт первый советский бейсбольный стадион (сегодня не функционирует);
среди окончивших МГУ имени М. В. Ломоносова 11 нобелевских лауреатов — поэт Б.Л. Пастернак, физик Л.Д. Ландау, советский физик и академик А.Д. Сахаров и другие.
